description:
Nằm Khu Đấu Giá Đa Sỹ Kiến Hưng, đường 13.5m xe tải tránh, vỉa hè rộng, nhiều cây xanh, gần chợ, siêu thị, trường học, Bệnh viện. Hạ tầng đồng bộ, dân cư đông đúc. 

Giao thông cực kỳ thuận tiện đi trung tâm Hà Nội và các Quận Huyện ngoại thành. Cách phố Hà Trì - Kiến Hưng chỉ 150m, trung tâm quận Hà Đông 1km. 

Giao thông thuận tiện, gần KĐT Văn Phú, KĐT Thanh Hà, KĐT Xa La, đối diện Kiến Hưng Luxury... Khu vực tương lai, an cư lạc nghiệp, đầu tư sinh lời. 

   Thiết kế: Hiện đại, thoáng sáng
+ Tầng 1: Thông sàn kinh doanh, gara ô tô. + Tầng 2: P. Khách, bếp; 
+ Tầng 3: 01 P. Ngủ master, WC; 
+ Tầng 4: 02 Ngủ, Wc; 
+ Tầng 5: P. Thờ, khu giặt, sân phơi, sân chơi. 

Sổ Đỏ chính Chủ Sẳn bán.
